def showRF():
    import numpy as np
    from scipy.signal import savgol_filter
    import matplotlib.pyplot as plt

    data = np.array(data_test)
    data[:, 0] = range(0, data.shape[0])
    x = data[:, 0]
    y = data[:, 1]
    z = data[:, 3]
    y2 = savgol_filter(y, window_length=351, polyorder=3)
    z2 = savgol_filter(z, window_length=351, polyorder=3)

    fig, ax = plt.subplots()
    plt.plot(x, y, color='r', linestyle='-', linewidth=1, alpha=.1)
    r, = plt.plot(x, y2, color='r', label='R/F Real')
    plt.plot(x, z,color='b', linestyle='-', linewidth=1, alpha=.1)
    f, = plt.plot(x, z2, color='b', label='R/F Fake')
    ax.spines['bottom'].set_position('zero')
    fig.suptitle('R/F Discriminator Loss')
    ax.spines['right'].set_visible(False)
    ax.spines['top'].set_visible(False)
    plt.xlabel('Iterations', fontsize=10)
    plt.ylabel('MSELoss', fontsize=10)
    plt.grid(linestyle='-', alpha=.2)
    plt.legend(handles=[r, f])
    plt.ylim(top=1.0)
    plt.ylim(0.0)
    plt.show()


